// src/LoginButton.js
import React from 'react';

const LoginButton = () => {
    const handleLogin = () => {
        // Redirect to the server's login route
        window.location.href = 'http://localhost:3001/login';
    };

    return (
        <button onClick={handleLogin}>
            Log in with Spotify
        </button>
    );
};

export default LoginButton;
